import { useState } from "react";
import { Link } from "react-router-dom";
import { HiMenu, HiX } from "react-icons/hi"; // install react-icons

export default function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-black text-white p-4 flex justify-between items-center">
      <h1 className="font-bold text-xl">GenVision 2025</h1>

      {/* Desktop Menu */}
      <div className="hidden md:flex gap-8 text-lg font-semibold">
        <Link to="/" className="px-2 hover:text-gray-300">About</Link>
        <Link to="/Events" className="px-2 hover:text-gray-300">Events</Link>
        <Link to="/Participants" className="px-2 hover:text-gray-300">Participate</Link>
        <Link to="/Coordinators" className="px-2 hover:text-gray-300">Coordinators</Link>
        <Link to="/Guests" className="px-2 hover:text-gray-300">Guests</Link>
      </div>

      {/* Mobile Menu Button */}
      <div className="md:hidden">
        <button onClick={() => setIsOpen(!isOpen)}>
          {isOpen ? <HiX size={28} /> : <HiMenu size={28} />}
        </button>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <div className="absolute top-full left-0 w-full bg-black flex flex-col items-center gap-4 py-4 md:hidden">
          <Link to="/" className="px-2 py-1 hover:text-gray-300" onClick={() => setIsOpen(false)}>About</Link>
          <Link to="/Events" className="px-2 py-1 hover:text-gray-300" onClick={() => setIsOpen(false)}>Events</Link>
          <Link to="/Participants" className="px-2 py-1 hover:text-gray-300" onClick={() => setIsOpen(false)}>Participate</Link>
          <Link to="/Coordinators" className="px-2 py-1 hover:text-gray-300" onClick={() => setIsOpen(false)}>Coordinators</Link>
          <Link to="/Guests" className="px-2 py-1 hover:text-gray-300" onClick={() => setIsOpen(false)}>Guests</Link>
        </div>
      )}
    </nav>
  );
}
